{"blocks":[{"key":"bthad","text":"Performance and limitations","type":"align-justify","depth":0,"inlineStyleRanges":[{"style":"bold","offset":0,"length":27}],"entityRanges":[],"data":{}},{"key":"e6171","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"19uqp","text":"Ribonucleic Acid (RNA) is a highly labile biomolecule that very susceptible to degradation by ubiquitous enzymes known as RNases. Care must be taken to ensure that all reagents, equipment and working environment are free of RNase contamination.","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"9ihhj","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"a1c6g","text":"False negative result may occur if insufficient target is present due to improper sample transport or storage conditions.","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"65uc4","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"3gbqn","text":"RNA is a highly labile biomolecule that must be protected from near-ubiquitous degrading RNase enzymes temperature fluctuations. All RNA work should be conducted “on ice” (RNase activity restricted at 4C) ","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"4ado4","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"5cag0","text":"During the concentration process substances which can inhibit enzyme activity and therefore interfere with the qPCR process can also be extracted. Inhibition is monitored by the inclusion of an internal control added. The addition of extra protein (i.e. BSA) can help to reduce inhibition. ","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"3cvn6","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"2v622","text":"If target sequences are present in very low starting concentrations then a clear signal to noise ratio will be difficult to achieve.","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"f8qhk","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"2urcg","text":"*In this protocol we used separated microbiological safety cabinets for mastermix preparation, positive template control and samples*","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"bvucl","text":"This protocol describes an RT-qPCR using AriaMx or MxPro qPCR instruments (Agilent). ","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"723m8","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"7n1li","text":"Interpretation guidelines","type":"align-justify","depth":0,"inlineStyleRanges":[{"style":"bold","offset":0,"length":25}],"entityRanges":[],"data":{}},{"key":"5rrqp","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"daail","text":"Once QC data has been checked raw data can be exported to XL  where the number of gene copy equivalent per litre can be calculated. As is standard for laboratory tests of this nature, there are two numerical values which are important to understanding how much weight should be given to the value.  These are known as the Limit of Detection (LoD) and the Limit of Quantification (LoQ). The limit of detection is the value at which the test has been determined to detect the virus material with certainty. The Limit of Quantification is the value, above which the test has been deemed to measure to virus material with a high degree of accuracy. ","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"27kqc","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"9srfl","text":"The Limit of Quantification was defined as the most dilute qPCR standard i.e. 5 copies per µl, equivalent to 1,500 genome equivalents per litre when 40 ml of wastewater was processed. ","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"2vrfo","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"drnk7","text":"Values for reference:","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"9bgqj","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"dt14l","text":"Limit of Detection (LoD) = 1,316 gc/L","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"f0i42","text":"Limit of Quantification (LoQ) = 11,368 gc/L","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"8o8cu","text":"Detected but not quantifiable or "Positive (DNQ)" description is given to the sample where the average value of the replicates is between the LoD and the LoQ (i.e. between 1,316 and 11,386 gene copies per litre).","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"2ml4q","text":""Weak Positive" will be given where two of three replicates return a positive signal but that signal is calculated as lower than the limit of detection (LoD). ","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"5koaj","text":"A sample is described as "Negative" where two replicates or two out of the three replicate tests return no response for the COVID markers.
","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"69b1d","text":"Results are reported as follows:","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"nbcu","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"bf6b8","text":"If:","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"9l1bi","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"77e5i","text":"1. Replicate average > LoQ = Quantifiable positive result","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"f90kq","text":" Report average value as gene copies per liter – ex. “12345 gc/L"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"27tv1","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"a5kho","text":"2. Replicate average >LoD but <LoQ = Detected but not quantifiable","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"b8n7q","text":"Report as “Positive (DNQ)”","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"91rb7","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"4l6r8","text":"3. Replicate average <LoD = Weak Positive","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"9mnbo","text":"Report as “Weak Positive” ","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"bfrcc","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"9lchj","text":"4. Two or more replicates produce No Cq (No Ct) result: Negative","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"2km00","text":"Report as “Negative” ","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"b792k","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"6a1uk","text":"","type":"align-left","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"8803b","text":"LoQ and LoD calculation - Methodology

LoD and LoQ values were calculated based on the methodology described in a JRC Technical Report ","type":"align-left","depth":0,"inlineStyleRanges":[{"style":"bold","offset":0,"length":37}],"entityRanges":[],"data":{}},{"key":"do6do","text":""Verification of analytical methods for GMO testing when implementing interlaboratory validated methods"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"82o1n","text":" ":","type":"align-left","depth":0,"inlineStyleRanges":[],"entityRanges":[{"key":0,"offset":0,"length":1}],"data":{}},{"key":"846n2","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"cvsll","text":"“Procedure for Absolute LOQ (LOQabs): A dilution series of known amounts of copies per reaction is tested in at least 10 PCR replicates (e.g. 80, 60, 40, 20, 10, 5 copies and 1 copy per reaction). Then the RSDr is calculated for each dilution level. The LOQabs is estimated as the last dilution level where the RSDr* of the measurements is below 25 %.”","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"d0her","text":"       *RSDr: Relative repeatability standard deviation","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"388pe","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"dqhc7","text":"“Procedure for Relative LOD (LODrel): a positive control material of low concentration can be measured in 10 PCR replicates and if all replicates are positive, this infers that the LODrel is below or equal to the positive control material level.”","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"5k7n4","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"1a9qk","text":"","type":"align-justify","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key"